column8:
グリルのワンポイントやバックドアのアクセントに最適です。<BR>
装着は両面テープで色々な場所に貴方のアイデアで取り付けできます。
<hr>
【適合車名】ハイエース/レジアスエース<br>
【適合型式】200系<BR>
【適合年式】2004年8月～<BR>
【ブランド】ESSEX/エセックス
<hr>
【カラー】クロームメッキ<BR>
【サイズ】178mm×30mm
<hr>
<font color="#ff0000"><b>【必ずお読みください】</b></font><br>
※『1万円以上送料無料』対象外商品です。<br>
※別商品との同梱はできません。<br>
※お急ぎの方はご注文前に納期お問い合わせ下さい。<br>
※北海道・沖縄・離島の場合は送料着払いにてご対応させて頂きます。<BR><br>







