リアのエンブレムを可愛く飾るワンポイントアクセサリー♪<BR>
カラーは選べる4色！<BR><BR>

縦24mmまでのエンブレムに対応<BR><BR>

【エンブレムチャームサイズ】<BR>
横幅最大約：57mm<BR>
縦幅最大約：55mm<BR><BR>

【取り扱いカラー】<BR>
ピンク・ブルー・クリア・ブラック<BR><BR>

【ご注意】
●画像のAQUAロゴエンブレムは付属致しません。<BR>
●トヨタ純正部品となります。<BR>
